import React, { Component } from "react";

class CartTable extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <table>
        <tbody>
          <tr>
            <td>
              <img src="/img/item-1.png" width={80} />
            </td>
            <td>t-shirt</td>
            <td>01</td>
            <td>76$</td>
          </tr>
          <tr>
            <td>
              <img src="/img/item-1.png" />
            </td>
            <td>t-shirt</td>
            <td>01</td>
            <td>76$</td>
          </tr>
          <tr>
            <td>
              <img src="/img/item-1.png" />
            </td>
            <td>t-shirt</td>
            <td>01</td>
            <td>76$</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default CartTable;
